import React, {useState} from 'react';
import axios from 'axios';

function SearchBox ()  {

    const [pokemon, setPokemon] = useState([]);



    const getPokemon = () => {
      axios.get('https://cors-anywhere.herokuapp.com/https://trefle.io/api/v1/species/search?q=coconut&token=wfOfrblXggceP_xcDAcmmxDOO4XmIyJY1KgXKK0_utA')
        .then(response => {
          setPokemon(response.data.data);
          // console.log(response);
        });

      };

      return (
        <div className="App">  
          <button onClick={getPokemon}>Fetch Plants</button>

          <div className="list">
            {pokemon.map((plant, index) => {
              return (<li plant={plant} key={index} > {plant.common_name} <img src="{plant.image_url}" alt="tryin"></img></li>)
            })}
          </div>

        </div>
      );

  }
  export default SearchBox;
